import axios from "axios";

const SearchImages = async () => {
  const response = axios.get(
    "https://api.spoonacular.com/recipes/complexSearch",
    {
      headers: {
        "Content-Type": "application/json",
      },
      params: {
        query: "pasta",
      },
    }
  );

  console.log(response);
  return response;
};

export default App;
